``` rust
# use chrono::{DurationRound, TimeDelta, RoundingError, NaiveDate};
let dt = NaiveDate::from_ymd_opt(2260, 12, 31)
    .unwrap()
    .and_hms_nano_opt(23, 59, 59, 1_75_500_000)
